import React from "react";
import { useState } from "react";
import '../style.css';
import * as color from '../colors.js';
function Dashboard(){
    return(
        <>
        <div style={{
            width:"100%"
        }}>
            <div>
                <h2 style={{marginTop:"0",color:color.contrast}}>DASHBOARD</h2>
            </div>
            <div style={{
                margin:"auto"
            }}>
                <table style={{
                    margin:"auto",
                    width:"70%"
                }}>
                    <tr>
                        <td>
                            Item
                        </td>
                        <td>
                            Units
                        </td>
                    </tr>
                </table>
            </div>
        </div>
        </>
    );
    
}
export default Dashboard;
